 do; Does he/she come up with constructive ideas or methods to improve hs/her work? Can he/she work with minimal supervision?','test'),('b-3481e9fd:160fe07b2f3:-7fcd',2,'Peer','DILIGENCE','Persistent and hard working in the performance of his/her tasks and responsibilities.','Does he/she look for ways to continue working/finish his/her task een in difficult situations?','test'),('b-3481e9fd:160fe07b2f3:-7fcdx',2,'Supervisor','DILIGENCE','Persistent and hard working in the performance of his/her tasks and responsibilities.','Does he/she look for ways to continue working/finish his/her task een in difficult situations?','test'),('b-3481e9fd:160fe07b2f3:-7fd5',1,'Peer','DEPENDABILITY/RELIABILITY','The extent of which the employee can be relied upon in the exection of assigned tasks and his ability to follow instructions and resolve problems with minimal supervision.','Does he/she deliver what is asked?','test'),('b-3481e9fd:160fe07b2f3:-7fd5x',1,'Supervisor','DEPENDABILITY/RELIABILITY','The extent of which the employee can be relied upon in the exection of assigned tasks and his ability to follow instructions and resolve problems with minimal supervision.','Does he/she deliver what is asked?','test'),('c2282a5b8:161690ab5b2:-7f8e',5,'Client','GROOMING AND APPEARANCE',NULL,'Does he/she present a neat and presentable appearance, wears proper uniform / attire and ID?',NULL),('c2282a5b8:161690ab5b2:-7f93',4,'Client','CLEANLINESS AND ORDERLINESS OF WORK AREA',NULL,'is his/her work area cleared of unsightful items, clean, organized and orderly?	',NULL),('c2282a5b8:161690ab5b2:-7f9b',3,'Client','READINESS FOR SERVICE',NULL,'is he/she always at his/her station, punctual, not engaging in unofficial matters like chatting, eating, telephoning, etc, while the client is waiting or watching?',NULL),('c2282a5b8:161690ab5b2:-7fa0',2,'Client','COUTERSY',NULL,'Is he/she polite, cordial, and attentive? Does he / she smile, greet clients, make the comfortable and at ease?',NULL),('c2282a5